import React from 'react';
import './style.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function Header() {
  return (
    <div className="App">
      <section class="bg-danger">
       <div class="container">
          <div class="row">
            <div class="col-sm-6">
             <div class="header">
                <ul class="list mt-3 font-">
                   <li><a href="">Home</a></li>
                   <li><a href="">Product</a></li>  
                   <li><a href="">About</a></li>  
                   <li><a href="">Contact</a></li>    
                </ul>  
              </div> 
             </div> 
             <div class="search">
                 <input type="text"/>
             </div>  
          </div>
        </div>
      </section> 
    </div>
  );
}

export default Header;
